function Banner(){this.bannerGroup=$("#banner-group"),this.listenBannerHover(),this.index=0}Banner.prototype.listenBannerHover=function(){var n=this;this.bannerGroup.hover(function(){clearInterval(n.timer)},function(){n.loop()})},Banner.prototype.loop=function(){var n=this,e=$("#banner-ul");this.timer=setInterval(function(){3<=n.index?n.index=0:n.index++,e.animate({left:-798*n.index},500)},2e3)},Banner.prototype.run=function(){this.loop()},$(function(){(new Banner).run()});